// src/components/Navbar.js
import React from 'react';
import { useNavigate } from 'react-router-dom'; // Import useNavigate
import '../styles/Navbar.css'; // Ensure you have the Navbar styles
import logo from '../assets/logo.png'; // Import your logo image

function Navbar() {
  const navigate = useNavigate(); // Initialize the useNavigate hook

  // Function to handle logo click
  const handleLogoClick = () => {
    navigate('/'); // Redirect to the home page where MainContent is rendered
  };

  return (
    <nav className="navbar">
      <div className="navbar-container">
        {/* Logo Section */}
        <div className="navbar-left">
          <img 
            src={logo} 
            alt="Logo" 
            className="navbar-logo" 
            onClick={handleLogoClick} // Add onClick to handle logo click
            style={{ cursor: 'pointer' }} // Optional: Change cursor to pointer
          />
        </div>

        {/* Keep your other navbar elements here */}
        <div className="navbar-right">
          {/* Example navigation links */}
          <a href="/uym">UYM</a>
          <a href="/news">News</a>
          <a href="/support">Support</a>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
